  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:13.534430\",\n\t\"name\": \"lostwood-national-wildlife-refuge-annual-narrative-report-calendar-year-1993-94\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  National Wildlife Refuge outlines Refuge accomplishments during the 1993-94 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the management plan, compliance
  with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, grasslands,
  grazing, haying, fire management, pest control, and wilderness and special areas.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh and water birds, shorebirds, raptors, other
  migratory birds, other resident wildlife, and animal control. The public uses of
  the Refuge described in this report include hunting, wildlife observation, and law
  enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, equipment utilization and replacement, and
  computer systems. Cooperative programs and items of interest are provided at the
  end. Photographs, newspaper articles, and brochures are attached.\",\n\t\"license_title\":
